import{_ as A}from"./006-D-lAiJXD.js";import{_ as o}from"./008-C6TVXSfy.js";import{_ as t}from"./009-CELUo195.js";import{_ as p}from"./010-DDUYNioq.js";import{_ as n}from"./011-57kAEd1K.js";import{_ as a}from"./012-CQSyaFwC.js";import{_ as l}from"./013-QBaRAmgp.js";import{_ as g}from"./014-C7RHCIAC.js";import{_ as i}from"./015-yQUJDJAP.js";import{_ as e,a as r}from"./017-BHmijlbt.js";import{_ as c,a as m}from"./019-B_nFAqnp.js";import{_ as d}from"./020-BdANhsvJ.js";import{_ as V,c as u,a as C,o as q}from"./app-CUu1n7_5.js";const w="/parts-intellect-docs/assets/425-bE3IG1Iw.png",B="data:image/png;base64,",b="data:image/png;base64,",M="data:image/png;base64,",K="data:image/png;base64,",O="data:image/png;base64,",h="data:image/png;base64,",R="data:image/png;base64,",f="data:image/png;base64,",X="data:image/png;base64,",Q="data:image/png;base64,",v="data:image/png;base64,",D="data:image/png;base64,",E="data:image/png;base64,",L="data:image/png;base64,",z="/parts-intellect-docs/assets/440-Yh5lJgSt.png",G="data:image/png;base64,",x="data:image/png;base64,",U="data:image/png;base64,",S="data:image/png;base64,",N="data:image/png;base64,",Y="/parts-intellect-docs/assets/446-DLKU_r3v.png",F="data:image/png;base64,",J="/parts-intellect-docs/assets/448-B3or0Hgz.png",Z={};function I(P,s){return q(),u("div",null,s[0]||(s[0]=[C('<p>Помимо ввода произвольного текста, существует возможность ввода <strong>формул</strong> для требуемых преобразований. Часть формул позволяет использовать регулярные выражения.</p><p><img src="'+w+'" alt=""></p><p><img src="'+A+'" alt=""> <strong>MD5</strong></p><p><img src="'+B+'" alt=""></p><p>Данная функция, получив на вход любую строку/текст, возвращает на выходе строку из 32 символов (при помощи md5 шифрования). Так называемый хэш. Причем подав на вход несколько раз одну и ту же строку/текст, на выходе будет один и тот же хэш. А подав разные текста (если отличие даже в одном символе), хэш на выходе будет разным.</p><p>Синтаксис:</p><p><code>= MD5 (ЗНАЧЕНИЕ)</code></p><div class="hint-container note"><p class="hint-container-title">Пример</p><p>Поставщик в своих прайс-листах не предоставляет артикулы товаров, только производителя, расширенное наименование и характеристики товара. В частности, прайс-лист шин/дисков. Необходимо иметь возможность работать с такими прайс-листами. Для этого при импорте в качестве артикула указывается функция MD5 от названия товара и ключевых характеристик (через функцию СЦЕПИТЬ). Тем самым мы получаем идентификатор конкретной записи прайс-листа, т.е. конкретного товара. При первом использовании позиций такого прайс-листа будут созданы карточки товаров с ХЭШЕМ вместо артикула. Но даже после многократного обновления прайс-листа, ХЭШ позиций нового прайс-листа будет совпадать с ХЭШЕМ в артикуле имеющихся карточек товара.</p></div><p><img src="'+o+'" alt=""> <strong>ЕСЛИ</strong></p><p><img src="'+b+'" alt=""></p><p>Отвечает за условное присвоение значения свойства. Первым аргументом является логическое условие (например, Col3 = 0); вторым аргументом является значение, если логическое условие верно; а последним аргументом значение, если логическое условие неверно.</p><div class="hint-container note"><p class="hint-container-title">Примеры</p><p><code>=ЕСЛИ(Col3 &lt; 0, &quot;0&quot;, Col3)</code> Если значение из Col3 меньше 0, то в свойство записываем &quot;0&quot;, иначе значение из колонки Col3.</p><p><code>=ЕСЛИ(Col1 &gt;= 150.00, &quot;*Больше либо равно 150.00*&quot;, &quot;*Меньше 150.00*&quot;)</code> Если значение в Col1 больше или равно 150.00, то в свойство вставляем текст &quot;<em>Больше либо равно 150.00</em>&quot;, иначе текст &quot;<em>Меньше 150.00</em>&quot;.</p><p><code>=ЕСЛИ(Col1 != &quot;Пропуск&quot;, Col2, Col3)</code> Если значение в Col1 не равно тексту &quot;Пропуск&quot;, то берем значение из Col2, иначе из Col3.</p></div><p><img src="'+t+'" alt=""> <strong>ЗАМЕНИТЬ</strong></p><p><img src="'+M+'" alt=""></p><p>Отвечает за замену значений в выбранном столбце на требуемые значения.</p><p>Синтаксис:</p><p><code>=ЗАМЕНИТЬ (ИМЯ\\_ПОЛЯ, &quot;ШАБЛОН\\_ПОИСКА&quot;, &quot;ШАБЛОН\\_ЗАМЕНЫ&quot;, &quot;0\\_1 ИСПОЛЬЗОВАТЬ\\_МНОЖЕСТВЕННУЮ\\_ЗАМЕНУ&quot;)</code></p><p>Последний параметр не является обязательным и равен 1. В этом случае допустимо разделять значения шаблонов поиска и замены символом &quot;/&quot;, но обязательным условием является совпадение количества ограничителей в шаблоне поиска и замены.</p><div class="hint-container note"><p class="hint-container-title">Пример</p><p>Формула <code>=ЗАМЕНИТЬ(col3, &quot;++/+&quot;, &quot;&gt;100/&gt;1&quot;)</code> заменит в колонке col3 все значения <code>++</code> на <code>&gt;100</code>, а <code>+</code> на <code>&gt;1</code>. Данную формулу можно записать и так <code>=ЗАМЕНИТЬ(col3, &quot;++/+&quot;, &quot;&gt;100/&gt;1&quot;, 1)</code>, указав последний параметр явно.</p><p>Если последний параметр указан и равен 0, то множественные замены недопустимы. Но допускается обработка строк, содержащих символ &quot;/&quot;.</p></div><p><img src="'+p+'" alt=""> <strong>ЗАМЕНИТЬШАБЛОН</strong></p><p><img src="'+K+'" alt=""></p><p>Формула возвращает строку с замененным текстом. При этом в качестве шаблона поиска используется регулярное выражение.</p><p><code>= ЗАМЕНИТЬШАБЛОН (Col1, «\\D», «0») // Заменит в колонке Col1 все нецифровые символы на нули</code></p><p><img src="'+n+'" alt=""> <strong>НАЙТИПОШАБЛОНУ</strong></p><p><img src="'+O+'" alt=""></p><p>Функция возвращает строку, соответствующую регулярному выражению.</p><p><code>=НАЙТИПОШАБЛОНУ (Col1, «(\\w+@[a-zA-Z\\_]+?\\.[a-zA-Z]{2,6})») // Вернет email адрес</code></p><p><img src="'+a+'" alt=""> <strong>ОКРУГЛИТЬ</strong></p><p><img src="'+h+'" alt=""></p><p>Функция позволяет округлить считываемое значение до указанного количества знаков после запятой. Первым аргументом указывается колонка, из которой читаются данные, а вторым аргументом – число разрядов для округления.</p><div class="hint-container note"><p class="hint-container-title">Пример</p><p><code>=ОКРУГЛИТЬ( Col1, 2) // Функция берет значение из Col1 и округляет его до двух знаков после запятой.</code></p><p><code>=ОКРУГЛИТЬ( Col7, 0) // Функция берет значение из Col7 и округляет его до целых чисел.</code></p></div><p><img src="'+l+'" alt=""> <strong>ОЧИСТИТЬ</strong></p><p><img src="'+R+'" alt=""></p><p>Отвечает за очистку выбранных значений у обновляемых записей: товаров, контрагентов, прайс-листов от поставщиков. Данная формула работает при импорте файла в режиме обновления для программы на базе MS SQL или PostgreSQL.</p><p><code>=ОЧИСТИТЬ</code></p><p>Поля у обновляемых записей, в которых указана данная функция, будут очищены.</p><p><img src="'+g+'" alt=""> <strong>ПОВТОРИТЬ</strong></p><p><img src="'+f+'" alt=""></p><p>Повторяет выбранную строку указанное количество раз.</p><p><code>=ПОВТОРИТЬ (Col1,5) // Строка, содержащая пять значений из колонки Col1 подряд.</code></p><p><code>=ПОВТОРИТЬ («АА»,2) // Строка &quot;АААА&quot;.</code></p><p><img src="'+i+'" alt=""> <strong>ПОДСТРОКА</strong></p><p><img src="'+X+'" alt=""></p><p>Отвечает за извлечение подстроки из искомой строки. Например, в Счете-Фактуре нет выделенной колонки с артикулом товара, вместо этого артикул товара находится в колонке с названием товара. Для выделения артикула из колонки с названием можно воспользоваться функцией &quot;=ПОДСТРОКА&quot;.</p><div class="hint-container note"><p class="hint-container-title">Синтаксис:</p><p>Первый аргумент содержит наименование колонки, из которой выделяется подстрока.</p><p>Второй аргумент указывает функции, где расположена подстрока: в начале или конце искомой строки. Значение &quot;0&quot; если в начале и &quot;1&quot; если в конце.</p><p>Третий аргумент указывает функции один или два символа-разделителя.</p></div><p>Примеры:</p><ul><li><p>&quot; &quot; – искомая подстрока выделена символом &quot;пробел&quot;,</p></li><li><p>&quot;&quot; – искомая подстрока выделена символом &quot;&quot;,</p></li><li><p>&quot;()&quot; – искомая подстрока находится внутри круглых скобок,</p></li><li><p>&quot;{}&quot; – искомая подстрока находится внутри фигурных скобок.</p></li></ul><p>Например, для выделения подстроки с начала искомой строки до символа &quot;пробел&quot;:</p><p><code>=ПОДСТРОКА(Col2, &quot;0&quot;, &quot; &quot;)</code></p><p><img src="'+e+'" alt=""> <strong>ПРОИЗВОЛЬНО_ЗНАЧЕНИЕ</strong></p><p><img src="'+Q+'" alt=""></p><p>Отвечает за установку произвольных значений у обновляемых записей: товаров, контрагентов, прайс-листов от поставщиков. Данная формула работает при импорте файла в режиме обновления для программы на базе MS SQL или PostgreSQL.</p><p><code>=ПРОИЗВОЛЬНОЕ\\_ЗНАЧЕНИЕ</code></p><p>Поля у обновляемых записей, в которых указана данная функция, примут произвольные значения.</p><p><img src="'+r+'" alt=""> <strong>СОДЕРЖИТСТРОКУ</strong></p><p><img src="'+v+'" alt=""></p><p>Функция возвращает ПРАВДУ, если в искомой строке найдена указанная подстрока.</p><p><code>= СОДЕРЖИТСТРОКУ (Col1, «ремень») // Вернет ПРАВДУ, если в ячейке из Col1 текст содержит слово &quot;ремень&quot;.</code></p><p><img src="'+c+'" alt=""> <strong>СОДЕРЖИТШАБЛОН</strong></p><p><img src="'+D+'" alt=""></p><p>Функция возвращает ПРАВДУ, если в искомой строке найдено соответствие указанному регулярному выражению.</p><p><code>=СОДЕРЖИТШАБЛОН (Col1, «^((8|\\+7)[\\- ]?)?(\\(?\\d{3}\\)?[\\- ]?)?[\\d\\- ]{7,10}$») // Вернет ПРАВДУ, если в ячейке из Col1 содержится номер телефона.</code></p><p><img src="'+m+'" alt=""> <strong>СЦЕПИТЬ</strong></p><p><img src="'+E+'" alt=""></p><p>С помощью данной функции можно сцеплять произвольное количество текстовых строк.</p><div class="hint-container note"><p class="hint-container-title">Пример</p><p><code>=СЦЕПИТЬ(Col1, &quot; руб&quot;)</code> Добавит после к значению из Col1 текст &quot;руб&quot;.</p><p><code>=СЦЕПИТЬ(Col1, Col2)</code> Сцепит две строки из Col1 и Col2.</p><p><code>=СЦЕПИТЬ( &quot;Итого: &quot;, Col1, &quot;руб за &quot;, Col2, &quot;штук.&quot;)</code> Выведет текст, подставив значения из Col1 и Col2.</p></div><p><img src="'+d+'" alt=""> <strong>ЯЧЕЙКА</strong></p><p><img src="'+L+`" alt=""></p><p>Формула позволяет использовать при импорте значение из конкретной ячейки импортируемой таблицы. Координаты ячейки задаются в виде имени столбца и номера строки.</p><div class="hint-container note"><p class="hint-container-title">Пример</p><p><code>=ЯЧЕЙКА(Col5, 14)</code></p><p><code>=ЯЧЕЙКА(F11, 2)</code></p></div><p>Мастер импорта сначала считывает значения используемых ячеек (даже если они не попадают в импортируемый диапазон строк), а затем использует эти значения при импорте табличной части документа. Тем самым, нельзя использовать внутри формулы ЯЧЕЙКА другие формула. Но при этом формулу ЯЧЕЙКА можно использовать внутри других формул.</p><ul><li><strong>Арифметические формулы</strong> – операции над числами: ‘+’, ‘–‘, ‘*’, ‘/’ и приоритет операции в &quot;()&quot;.</li></ul><div class="hint-container note"><p class="hint-container-title">Примеры</p><p><code>=Col1 + 100</code> Складываем значение из Col1 с числом 100</p><p><code>=Col1 \\* Col2 – 10</code> Перемножаем значение в Col1 и Col2, а из результата вычитаем 10</p><p><code>=(Col1/(Col1+Col2))\\*100</code> Вычисляем процент Col1 от Col1+Col2.</p></div><p>Многие формулы можно вкладывать друг в друга, где результат вложенной формулы будет аргументом для вышестоящей формулы. А также использовать &amp;&amp; и || в качестве логических &quot;И&quot; и &quot;ИЛИ&quot; соответственно.</p><p>Ниже пример использования нескольких формул при импорте. Формула разбита на абзацы для лучшего восприятия, после &quot;//&quot; идет комментарий, в колонке Col1 цена за штуку, в Col2 количество товара. На выходе формулы либо текст со стоимостью и количеством, либо сообщение об ошибке:</p><div class="language-" data-highlighter="shiki" data-ext="" style="--shiki-light:#393a34;--shiki-dark:#dbd7caee;--shiki-light-bg:#ffffff;--shiki-dark-bg:#121212;"><pre class="shiki shiki-themes vitesse-light vitesse-dark vp-code"><code><span class="line"><span>=ЕСЛИ //Функция если</span></span>
<span class="line"><span>(</span></span>
<span class="line"><span>  Col1 != &quot;&quot; &amp;&amp; Col2 != &quot;&quot;, //Проверяем, что обе колонки заполнены</span></span>
<span class="line"><span>  СЦЕПИТЬ // Если обе колонки заполнены, выводим текст «Итого: Х руб за Y штук.», где X это сумма, а Y количество покупаемого товара</span></span>
<span class="line"><span>    (</span></span>
<span class="line"><span>    &quot;*Итого*: &quot;,</span></span>
<span class="line"><span>    Col1 \\* Col2, // Перемножаем цену на количество</span></span>
<span class="line"><span>    &quot;*руб* *за* &quot;,</span></span>
<span class="line"><span>    Col2,</span></span>
<span class="line"><span>    &quot;*штук*.&quot;</span></span>
<span class="line"><span>    ),</span></span>
<span class="line"><span>  СЦЕПИТЬ // Если хотя бы одна колонка имеет пустое значение, то формируем строку с ошибкой</span></span>
<span class="line"><span>    (</span></span>
<span class="line"><span>    &quot;*Внимание! Не заполнены обязательные поля:* &quot;,</span></span>
<span class="line"><span>    ЕСЛИ</span></span>
<span class="line"><span>      (</span></span>
<span class="line"><span>      Col1 = &quot;&quot;,</span></span>
<span class="line"><span>      &quot;*ЦЕНА*&quot;,</span><span> // Выводим ЦЕНА, если не заполнена колонка с ценой</span></span>
<span class="line"><span>      &quot;&quot;</span></span>
<span class="line"><span>      ),</span></span>
<span class="line"><span>  ЕСЛИ</span></span>
<span class="line"><span>      (</span></span>
<span class="line"><span>      Col1 = &quot;&quot; &amp;&amp; Col2= &quot;&quot;,</span></span>
<span class="line"><span>      &quot; *и* &quot;,</span><span> // Выводим союз «и», если не заполнены обе колонки</span></span>
<span class="line"><span>      &quot;&quot;</span></span>
<span class="line"><span>      ),</span></span>
<span class="line"><span>  ЕСЛИ</span></span>
<span class="line"><span>      (</span></span>
<span class="line"><span>      Col2 = &quot;&quot;,</span></span>
<span class="line"><span>      &quot;*КОЛИЧЕСТВО*&quot;,// Выводим КОЛИЧЕСТВО, если не заполнена колонка с кол-вом</span></span>
<span class="line"><span>      &quot;&quot;</span></span>
<span class="line"><span>      )</span></span>
<span class="line"><span>    )</span></span>
<span class="line"><span>)</span></span></code></pre></div><p><img src="`+z+'" alt=""></p><p><img src="'+A+'" alt=""> <strong>Табличная часть</strong></p><p>Содержит список записей импортируемых из документа, с названием колонок для установки разметки. каждой колонке можно осуществить фильтрацию данных.</p><p><img src="'+o+'" alt=""> <strong>Разметка колонок</strong></p><p>Позволяет установить соответствия колонок в файле с типом данных в программе в колонке <strong>Значение из файла/формула</strong>. Некоторые значения (валюта, страна и т.п.) можно установить из соответствующего справочника в программе в колонке <strong>Фиксированное значение из справочника</strong>.</p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Поля <strong>Базовая валюта</strong>, <strong>Товар.Производитель</strong>, <strong>Товар.Код –</strong> обязательные для разметки при импорте.</p></div><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>При разметке файлов при импорте можно использовать предустановленные в программе специальные формулы для упрощения процесса импорта.</p></div><p><img src="'+t+'" alt=""> <strong>Авторазметка</strong></p><p><img src="'+G+'" alt=""></p><p>Позволяет автоматически сопоставить название столбцов в файле и название колонок в программе. В случае совпадения программа автоматически назначает соответствующей колонке совпадающий столбец файла.</p><p><img src="'+p+'" alt=""> <strong>Очистить</strong></p><p><img src="'+x+'" alt=""></p><p>Позволяет сбросить ранее заданное соответствие колонок в файле и в программе.</p><p><img src="'+n+'" alt=""> <strong>Ранее созданные разметки</strong></p><p>Блок содержит ранее созданные и сохраненные разметки документов. Если импорт в приход из аналогично размеченного файла уже осуществлялся, и в программе сохранена эта разметка, то рекомендуется выбрать ее в списке, не создавая новую. Блок содержит <strong>Панель действий</strong> с командами:</p><ul><li><p><strong>Обновить</strong> – позволяет обновить список разметок;</p></li><li><p><strong>Новая</strong> – позволяет добавить новую разметку;</p></li><li><p><strong>Копировать</strong> – позволяет копировать существующую разметку, для дальнейшего редактирования;</p></li><li><p><strong>Сохранить</strong> – позволяет сохранить созданную или отредактированную разметку, которая будет доступна для последующего использования, в том числе для автоматизации импорта заказов клиентов с использованием bat-файла;</p></li><li><p><strong>Удалить</strong> – позволяет удалить существующую разметку.</p></li></ul><p><img src="'+a+'" alt=""> <strong>Примечание</strong></p><p>Позволяет оставить текстовое примечание для разметки.</p><p><img src="'+l+'" alt=""> <strong>Информация об импортируемом файле</strong></p><p>Блок содержит:</p><ul><li><p><strong>Обновить</strong> – которая позволят обновить данные о загруженном документе;</p></li><li><p><strong>Исходный файл</strong> – содержит полный путь на компьютере до импортируемого файла, при необходимости его можно заменить;</p></li><li><p><strong>Дата модификации</strong> – отображается последняя дата изменения документа.</p></li></ul><p><img src="'+g+'" alt=""> <strong>Таблицы/листы документа</strong></p><p><img src="'+U+'" alt=""></p><p>Отображаются вкладки таблиц/листов документа, который хранит импортируемые данные. При необходимости, выберите необходимую вкладку.</p><p><img src="'+i+'" alt=""> <strong>Диапазон записей</strong></p><p><img src="'+S+'" alt=""></p><p>Позволяет указать количество верхних/нижних строк, данные из которых не будут импортированы. Обычно данный параметр используется для того, чтобы предотвратить загрузку заголовка и названия колонок импортируемой таблицы.</p><p><img src="'+e+'" alt=""> <strong>Далее</strong></p><p><img src="'+N+'" alt=""></p><p>Позволяет перейти к вкладке с информацией о текущей конфигурацией.</p><p>Если осуществляется импорт очень большого объема информации (например, 15 миллионов аналогов в справочник &quot;Аналоги&quot;), рекомендуется осуществлять порционный импорт по 200 - 600 тысяч записей за раз. Для этого рекомендуется: вызвать импорт – выбрать файл – создать и сохранить разметку для файла – указать диапазон &quot;0 - 500 000&quot; – осуществить импорт. Далее снова: вызвать импорт – указать тот же файл – выбрать уже сохраненную разметку – указать следующий диапазон &quot;500 001 – 1 000 000&quot; – осуществить импорт. И так до полного импорта содержимого файла в программу.</p><p>В качестве подсказки программа выделяет цветом строки в разметке: красный – ошибка, зеленый – значение проверено, розовый – стандартное значение, синий – поле обязательное для заполнения.</p><p>Нажав кнопку <strong>Далее</strong>, мастер импорта предложит ознакомиться с текущей конфигурацией.</p><p><img src="'+Y+'" alt=""></p><p><img src="'+A+'" alt=""> <strong>Начать</strong></p><p><img src="'+F+'" alt=""></p><p>Позволяет начать импорт в документ.</p><p>В случае одобрения нажать кнопку <strong>Начать</strong>. Данные из файла будут загружены в программу.</p><p>По окончанию импорта выводится статистика:</p><ul><li><p><strong>Добавлено</strong> – количество записей, выбранных из файла для импорта;</p></li><li><p><strong>Обновлено</strong> – количество позиций, которые были обновлены;</p></li><li><p><strong>Пропущено</strong> – количество позиций, которые не были импортированы;</p></li><li><p><strong>Выбрано из файла</strong> – количество позиций, которые были выбраны для импорта;</p></li><li><p><strong>Всего в файле</strong> – количество позиций в файле (активной таблице/листе).</p></li></ul><p><img src="'+J+'" alt=""></p>',117)]))}const nA=V(Z,[["render",I]]),aA=JSON.parse('{"path":"/work/export_import/import/ispolzovanie_formul_pri_importe.html","title":"Использование формул при импорте","lang":"en-US","frontmatter":{"title":"Использование формул при импорте","createTime":"2025/06/01 12:20:41"},"headers":[],"readingTime":{"minutes":5.65,"words":1695},"git":{"updatedTime":1748775339000,"contributors":[{"name":"a.lutoshkin","username":"","email":"a.lutoshkin@tradesoft.ru","commits":1,"avatar":"https://gravatar.com/avatar/605ee9d365e3a6380f8e9c71f9269ee5373d537aebefbece4e023cac396dfc8d?d=retro"}]},"filePathRelative":"work/export_import/import/ispolzovanie_formul_pri_importe.md","categoryList":[{"id":"67e92c","sort":10000,"name":"work"},{"id":"094f0e","sort":10014,"name":"export_import"},{"id":"7d0bb1","sort":10015,"name":"import"}]}');export{nA as comp,aA as data};
